import "./App.css";
import Login from "./login,signin/Login";
import Mignup from "./login,signin/Mignup";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import ChatList from "./Component/ChatList";
import Contents from "./Component/Contents";
import FileOfMessages from "./Component/FileOfMessages";

function App() {
  return (
    <Router>
      {/* <Switch> */}
        <Route path="/" component={Login} />
        <Route path="/Mignup" component={Mignup} />

        {/* <Route path="/ChatApp" component={ChatApp}/> */}
      {/* </Switch> */}
    </Router>
  );
}

const Home = () => (
  <div>
    <h1>Home hello every one to Home page</h1>
  </div>
);

export default App;
